        this.#txCfg = txCfg;
        this.logs = (txCfg?.logs) ? txCfg.logs : null;
        this.infos = (txCfg?.infos) ? txCfg.infos : null;
        this.warnings = (txCfg?.warnings) ? txCfg.warnings : null;
        this.errors = (txCfg?.errors) ? txCfg.errors : null;
